generators.template_text:
policy-options {
    prefix-list ssh-whitelist {
        10.85.192.0/26;
        10.104.0.0/16;
    }
    prefix-list apstra-servers {
        10.85.192.45/32;
    }
    prefix-list bgp-neighbors-global {
        apply-path "protocols bgp group <*> neighbor <*>";
    }
    prefix-list bgp-neighbors-ri {
        apply-path "routing-instances <*> protocols bgp group <*> neighbor <*>";
    }
}
firewall {
    family inet {
        filter re-protect {
            term ssh-allow {
                from {
                    source-prefix-list {
                        ssh-whitelist;
                        apstra-servers;
                    }
                    protocol tcp;
                    destination-port [ ssh 830 ];
                }
                then accept;
            }
            term ssh-deny {
                from {
                    protocol tcp;
                    destination-port [ ssh 830 ];
                }
                then {
                    discard;
                }
            }
            term bgp-allow {
                from {
                    source-prefix-list {
                        bgp-neighbors-global;
                        bgp-neighbors-ri;
                    }
                    protocol tcp;
                    destination-port bgp;
                }
                then accept;
            }
            term bgp-deny {
                from {
                    protocol tcp;
                    destination-port bgp;
                }
                then {
                    discard;
                }
            }
            term else {
                then accept;
            }
        }
    }
}
interfaces {
    lo0 {
        unit 0 {
            family inet {
                filter {
                    input re-protect;
                }
            }
        }
    }
}

system {
    login {
        user labroot {
            class super-user;
            authentication {
                encrypted-password "$6$o0oFDCXs$GVVRn8Rmt/QaDhg0KHmo3mErxBZM4g8xbxOqonmLhpiaPauY2hXbevrNpa7e2I3pKDsgYrnDjEsAC3/KOjpcV1"; ## SECRET-DATA
            }
        }
    }
    services {
        ssh {
            sftp-server;
            ciphers [ "aes128-gcm@openssh.com" "aes256-gcm@openssh.com" aes256-ctr ];
            key-exchange [ dh-group14-sha1 ecdh-sha2-nistp256 ecdh-sha2-nistp384 ecdh-sha2-nistp521 ];            
        }
    }
    ntp {
        server 10.85.130.130 routing-instance mgmt_junos;
    }
}

{#
Configure snmp v3 with generated keys instead of plain text keys.

Test command example:
    snmpwalk -v3  -l authPriv -u v3-user-a -a SHA-256 -A secure-auth-password -x AES-128 -X secure-priv-password 10.85.192.16 .1.3.6.1.2.1.1

#}

{# use fixed engine_id to produce consistent keys #}
{% set engine_id = 8888 %}
{% set v3_user_a = "v3-user-a" %}
{# The following key is generated using the following command:
    set snmp v3 usm local-engine user v3-user-a authentication-sha256 authentication-password secure-auth-password
    show snmp v3 usm local-engine user v3-user-a authentication-sha256 authentication-key
#}
{% set v3_auth_key_a = "$9$L7oxwYGDiPTz7-Hqf5F3M8LNs2aZUm5QJZFnCA1IbsYoaUHkPTQnYgQFn9pu1RhylMNdbw24W8Ujq.zF/CtuORylKMWx9A0IEcleX7-bs4GDiqP5oaUHkmTQ369tBIEhrKvLRE24ZGq.0B1Ire7-Vws4-dgJZDkqRhcSvWNdbwgodVQFn/tpxN-dYg" %}
{# The following key is generated using the following command:
    set snmp v3 usm local-engine user v3-user-a authentication-sha256 authentication-password secure-priv-password
    show snmp v3 usm local-engine user v3-user-a privacy-aes128 privacy-key
#}
{% set v3_priv_key_a = "$9$D-iP59ApESrqmhSyrvMikqPz3n/C01Rtp7-dVY2GDi.QFn/Cu0IUjtuOIcS24oGUHQFn9CuzF9pO1yrgoaZk.QFn/9p3n" %}
{% set v3_group_a = "v3-group-a" %}
{% set v3_view_a = "v3-view-a" %}
{% set v3_oid_a = ".1.3.6.1.2" %}

snmp {
    v3 {
        usm {
            local-engine {
                user {{v3_user_a}} {
                    authentication-sha256 {
                        authentication-key "{{v3_auth_key_a}}"; ## SECRET-DATA
                    }
                    privacy-aes128 {
                        privacy-key "{{v3_priv_key_a}}"; ## SECRET-DATA
                    }
                }
            }
        }
        vacm {
            security-to-group {
                security-model usm {
                    security-name {{v3_user_a}} {
                        group {{ v3_group_a }};
                    }
                }
            }
            access {
                group {{ v3_group_a }} {
                    default-context-prefix {
                        security-model usm {
                            security-level authentication {
                                read-view {{ v3_view_a }};
                            }
                        }
                    }
                }
            }
        }
    }
    engine-id {
        local {{ engine_id }};
    }
    view {{ v3_view_a }} {
        oid {{ v3_oid_a }};
    }
    routing-instance-access;
}

{#
Remove RSTP of the target interfaces under the [edit protocols rstp] hierarchy.

To remove RSTP, attach the tag NO_RSTP_TAG to the target interfaces, links, or generic systems.
#}
{% set NO_RSTP_TAG = "no-rstp" %}
{% for intf in interface.values() %}
{% if 'tags' in intf and NO_RSTP_TAG in intf.tags %}
{% if 'part_of' in intf and intf.part_of.startswith('ae') %}
delete protocols rstp interface {{ intf.part_of }}
{% else %}
delete protocols rstp interface {{ intf.intfName }}
{% endif %}{# part_of #}
{% endif %}{# intf.tags #}
{% endfor %}

{# mirror the interface with intf_tags 'mirror' #}
{% set mirrored_interfaces = [] %}
{% for intf in interface.values() %}
{% if 'tags' in intf and 'mirror' in intf['tags'] %}
{% if intf['part_of'] == '' %}
{% set mirrored_interfaces = mirrored_interfaces.append(intf['intfName']) %}
{% else %}
{% set mirrored_interfaces = mirrored_interfaces.append(intf['part_of']) %}
{% endif %}
{% endif %}
{% endfor %}
{% if mirrored_interfaces|length %}
forwarding-options {
    analyzer {
        mirro1 {
            input {
                ingress {
{% for intf in mirrored_interfaces %}
                    interface {{ intf }}.0;
{% endfor %}
                }
                egress {
{% for intf in mirrored_interfaces %}
                    interface {{ intf }}.0;
{% endfor %}
                }
            }
            output {
                ip-address 192.168.0.2;
            }
        }
    }    
}
{% endif %}
